import styled from 'styled-components'
import { Link } from "react-router-dom";
import { ReactComponent as CloseDoor } from '../../assets/puerta_cerrada.svg'
import './landing.css'

export const EnterIcon = styled(CloseDoor)`
width: 20px;
height: 20px;
fill: #000000;
&:hover {
   scale: 1.2;
}`;

export const IconBox = styled.div`
   position: relative;
   display: flex;
   aling-items: center;
   justify-content: center;
   cursor: pointer;
   background-color: white;
   padding: 12px;
   border: solid #58FAF4 1px;
   border-radius: 50%;
   box-shadow: inset 0 0 5px #808080;
   &:hover {
      bos-shadow: inset 0 0 10px #58FAF4;
   }`;


const enter = styled(CloseDoor)
function Landing() {
   return (
      <body className="backgroundL">
         <div className="welcome">
            <h2>Proyect Dogs</h2>
         </div>
         <Link to='/home'>
            <button className="enter">Enter</button>
         </Link>
      </body>
   )
}

export default Landing;
